import React from 'react'
import classes from './Nav.module.css'
const Nav = props => {
  return (
    <button 
     className={classes.nav}
    onClick={props.showCart} >
      <span className={classes.icon}></span>
      <span>Cart</span>
      <span className={classes.badge}></span>
    </button>
  )
}


export default Nav
